import React,{useState,useEffect} from 'react'
import Layouts from '../../Layouts/Layouts'
import axios from 'axios';
function Projectdata() {
  const[data,setData] = useState([]);

  useEffect(()=>{
      const getData = async()=>{
         try{
           const response = await axios.get('http://localhost:5000/projects/allProjects');
           if(response){
             setData(response.data);
           }
         }catch(error){
          console.log("error while fetchiing");
         }
      }
      getData();
  },[])
  console.log(data);
  return (
    <Layouts>
        <table>
            <thead>
                <tr>
                    <th>SN</th>
                    <th>ProjectID</th>
                    <th>GuideID</th>
                    <th>GuideName</th>
                    <th>ReveiwerID</th>
                    <th>ReveiwerName</th>
                    <th>Action</th>
                </tr>
            </thead>
            <tbody>
              {data.guide.map((d,index)=>(
              	<tr key={index}>
              	 <th>
              	 {d.ProejctID}
              	 </th>
              	</tr>
              ))}
            </tbody>
        </table>
    </Layouts>
  )
}

export default Projectdata
